                    Headers = { ['Content-Type'] = 'application/json', Origin = 'https://discord.com' },
                    Body = HttpService:JSONEncode({
                        cmd = 'INVITE_BROWSER',
                        nonce = HttpService:GenerateGUID(false),
                        args = { code = InviteCode }
                    })
                })
            end)
            if success then
                print("Invite sent successfully on port " .. port)
                break
            end
        end
    end
end
